import React from "react";
import imageSrc from "./images/slide-pic1.png";

const MainSlider = () => {
  return (
    <div className="mainpage">
      <div className="slider">
        <div className="slide1">
          <img className="slide1" src={imageSrc} alt="slide1"></img>
        </div>
      </div>
    </div>
  );
};

export default MainSlider;
